export const Default = () => (
	<div>
		<NoticeBox
			recordCount={ 1 }
			tierMaximumRecords={ 100 }
			hasBeenIndexed={ true }
			hasValidData={ true }
			hasItems={ true }
		/>
		<p>No notice box should be rendered here; no notice is shown if there are no issues.</p>
	</div>
);

